import React from 'react';

function OrcamentoDetalhes({ orcamento }) {
  return (
    <div>
      <h2>Dados do Orçamento</h2>
      <p><strong>Distância:</strong> {orcamento.distancia} m</p>
      <p><strong>Quantidade de Eletrocalha:</strong> {orcamento.quantidadeEletrocalha} m</p>
      <p><strong>Quantidade de Duto Canaduto:</strong> {orcamento.quantidadeDutoCanaduto} m</p>
      <p><strong>Quantidade de Eletroduto PVC:</strong> {orcamento.quantidadeEletrodutoPVC} m</p>
      <p><strong>Desvios Canaduto:</strong> {orcamento.desviosCanaduto}</p>
      <p><strong>Desvios PVC:</strong> {orcamento.desviosPVC}</p>
      <p><strong>Conduletes:</strong> {orcamento.conduletes}</p>
      <p><strong>Quantidade de Curvas:</strong> {orcamento.quantidadeCurvas}</p>
      <p><strong>Observação:</strong> {orcamento.observacao}</p>

      <h2>Resultado do Orçamento</h2>
      <pre>{orcamento.resultado}</pre>
    </div>
  );
}

export default OrcamentoDetalhes;
